import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
        React Starter UI Template For Electronic Ecommerce web based app

        BY SalathielWekesa

        </p>

      </header>
    </div>
  );
}

export default App;
